import { NextResponse } from "next/server";
import nodeHtmlToImage from "node-html-to-image";
import JSZip from "jszip";

// Define the expected shape of the POST request body
interface CardData {
  brandName: string;
  contactNumber: string;
  address: string;
  frontLogoBase64: string | null;
  backLogoBase64: string | null;
}

// Define a helper function for generating card HTML
interface GenerateCardHtmlProps {
  brandName: string;
  contactNumber: string;
  address: string;
  logoBase64: string | null;
  isBack: boolean;
}

export async function POST(req: Request): Promise<NextResponse> {
  try {
    const data: CardData = await req.json();

    const {
      brandName,
      contactNumber,
      address,
      frontLogoBase64,
      backLogoBase64,
    } = data;

    // Generate the HTML content for front and back sides
    const frontHtml = generateCardHtml({
      brandName,
      contactNumber,
      address,
      logoBase64: frontLogoBase64,
      isBack: false,
    });

    const backHtml = generateCardHtml({
      brandName,
      contactNumber,
      address,
      logoBase64: backLogoBase64,
      isBack: true,
    });

    // Generate images using node-html-to-image
    const [frontImageBuffer, backImageBuffer] = await Promise.all([
      nodeHtmlToImage({
        html: frontHtml,
        quality: 100,
        type: "png",
        transparent: true,
        puppeteerArgs: { args: ["--no-sandbox", "--disable-setuid-sandbox"] },
      }) as Promise<Buffer>, // Type assertion for correct return type
      nodeHtmlToImage({
        html: backHtml,
        quality: 100,
        type: "png",
        transparent: true,
        puppeteerArgs: { args: ["--no-sandbox", "--disable-setuid-sandbox"] },
      }) as Promise<Buffer>,
    ]);

    // Create a ZIP archive containing both images
    const zip = new JSZip();
    zip.file("card-front.png", frontImageBuffer);
    zip.file("card-back.png", backImageBuffer);

    const zipBuffer = await zip.generateAsync({ type: "nodebuffer" });

    return new NextResponse(zipBuffer, {
      headers: {
        "Content-Type": "application/zip",
        "Content-Disposition": "attachment; filename=card-images.zip",
      },
    });
  } catch (error) {
    console.error("Error generating images:", error);
    return new NextResponse(
      JSON.stringify({ error: "Failed to generate images" }),
      { status: 500 }
    );
  }
}

// Helper function to generate HTML content
function generateCardHtml({
  brandName,
  contactNumber,
  address,
  logoBase64,
  isBack,
}: GenerateCardHtmlProps): string {
  // Variables for controlling layout
  const scaleFactor = 2; // Overall scaling factor
  const brandNameMarginTop = -4 * scaleFactor; // Adjust brand name position
  const lineSpacing = 1.6; // Line height for text
  const textMargin = 0; // Margin between lines of text
  const logoBrightness = 0; // Control logo brightness (1 = normal, >1 = brighter, <1 = darker)

  const logoImage = logoBase64
    ? `<img src="${logoBase64}" alt="Logo" style="width:${
        64 * scaleFactor
      }px;height:${64 * scaleFactor}px;object-fit:contain;margin-bottom:${
        4 * scaleFactor
      }px;filter:brightness(${logoBrightness}) invert(1);" />`
    : "";

  const content = isBack
    ? `
      <div style="position:relative;width:${336 * scaleFactor}px;height:${
        192 * scaleFactor
      }px;background-color:#000;color:#fff;font-family:'Poppins',sans-serif;">
        ${
          logoBase64
            ? `<div style="display:flex;justify-content:center;align-items:center;height:100%;">
                <img src="${logoBase64}" alt="Back Logo" style="width:${
                128 * scaleFactor
              }px;height:${
                128 * scaleFactor
              }px;object-fit:contain;opacity:0.75;filter:brightness(${logoBrightness}) invert(1);" />
              </div>`
            : ""
        }
      </div>
    `
    : `
      <div style="position:relative;width:${336 * scaleFactor}px;height:${
        192 * scaleFactor
      }px;background-color:#000;color:#fff;font-family:'Poppins',sans-serif;padding:${
        20 * scaleFactor
      }px;">
        <div style="position:absolute;bottom:${15 * scaleFactor}px;right:${
        15 * scaleFactor
      }px;">
          <img src="https://api.qrserver.com/v1/create-qr-code/?size=${
            48 * scaleFactor
          }x${48 * scaleFactor}&data=${encodeURIComponent(
        "https://zalient.me/username"
      )}" alt="QR Code" />
        </div>
        ${logoImage}
        <div style="margin-top:${brandNameMarginTop}px;line-height:${lineSpacing};"> <!-- Adjust text positioning -->
          <h2 style="font-size:${
            20 * scaleFactor
          }px;font-weight:bold;margin:0;font-family:'Pacifico',cursive;">${brandName}</h2>
          ${
            contactNumber
              ? `<p style="font-size:${
                  12 * scaleFactor
                }px;margin:${textMargin}px;">${contactNumber}</p>`
              : ""
          }
          ${
            address
              ? `<p style="font-size:${
                  12 * scaleFactor
                }px;margin:${textMargin}px;">${address}</p>`
              : ""
          }
        </div>
      </div>
    `;

  return `
    <!DOCTYPE html>
    <html>
    <head>
      <style>
      
        @font-face {
          font-family: 'Poppins';
          font-style: normal;
          font-weight: 400;
          src: url('data:font/woff2;base64,') format('woff2');
        }
        @font-face {
          font-family: 'Pacifico';
          font-style: normal;
          font-weight: 400;
          src: url('data:font/woff2;base64,') format('woff2');
        }
        
      </style>
    </head>
    <body>
      ${content}
    </body>
    </html>
  `;
}
